    DROP TABLE IF EXISTS TMP_tb_harga_satuan;
    DROP TABLE IF EXISTS TMP_SATUKAN;
    
    
 	CREATE TEMPORARY TABLE IF NOT EXISTS TMP_tb_produk AS (SELECT id_produk,kode_produk,nama_produk,nama_supplier FROM tb_produk WHERE kode_kantor = V_kode_kantor 
  															AND (
  																	kode_produk LIKE CONCAT('%', V_cari, '%') OR nama_produk LIKE CONCAT('%', V_cari, '%') OR nama_supplier LIKE CONCAT('%', V_cari, '%')
  																)
                                                                GROUP BY id_produk,kode_produk,nama_produk,nama_supplier
															  LIMIT V_offset,V_limit
  														   );
                                                            
 CREATE TEMPORARY TABLE IF NOT EXISTS TMP_tb_produk2 AS(SELECT * FROM TMP_tb_produk);
 CREATE TEMPORARY TABLE IF NOT EXISTS TMP_tb_produk3 AS(SELECT * FROM TMP_tb_produk);
 CREATE TEMPORARY TABLE IF NOT EXISTS TMP_tb_harga_satuan AS (
     
 															SELECT * FROM
                                                             (
 																SELECT A.id_produk,A.id_satuan,C.kode_satuan,'*' AS status, 1 AS besar_konversi,AVG(B.harga) AS harga FROM tb_produk AS A
 																LEFT JOIN tb_harga AS B
 																ON A.id_produk = B.id 
 																AND B.kode_kantor = V_kode_kantor
 																AND B.group_by ='produks'
 																AND B.set_default = '1'
 																AND B.id IN (SELECT id_produk FROM TMP_tb_produk GROUP BY id_produk)
 																LEFT JOIN 
 																(
 																	SELECT id_satuan,kode_satuan
 																	FROM tb_satuan
 																	WHERE kode_kantor = V_kode_kantor
 																	GROUP BY id_satuan,kode_satuan
 																)
 																AS C ON A.id_satuan = C.id_satuan
 																WHERE A.kode_kantor = V_kode_kantor AND A.id_produk IN (SELECT id_produk FROM TMP_tb_produk2 GROUP BY id_produk)
 																GROUP BY A.id_produk,A.id_satuan,C.kode_satuan
 																
 																UNION ALL
 																
 																SELECT A.id_produk,A.id_satuan,B.kode_satuan,A.status,A.besar_konversi,A.harga_jual 
 																FROM tb_satuan_konversi AS A
 																LEFT JOIN tb_satuan AS B ON A.id_satuan = B.id_satuan AND B.kode_kantor = V_kode_kantor
 																WHERE A.kode_kantor = V_kode_kantor
 																AND A.id_produk IN (SELECT id_produk FROM TMP_tb_produk3 GROUP BY id_produk)
 																GROUP BY A.id_produk,A.id_satuan,B.kode_satuan,A.status,A.besar_konversi,A.harga_jual
 															) AS AA
                                                             ORDER BY AA.id_produk ASC,AA.id_satuan ASC
 														);
 CREATE TEMPORARY TABLE IF NOT EXISTS TMP_SATUKAN AS (
 															SELECT A.id_produk,A.kode_produk,A.nama_produk,A.nama_supplier
 																	,B.id_satuan,B.kode_satuan,B.status,B.besar_konversi,COALESCE(B.harga,0) AS harga
                                                             FROM TMP_tb_produk AS A 
                                                             LEFT JOIN TMP_tb_harga_satuan AS B ON A.id_produk = B.id_produk
                                                             GROUP BY A.id_produk,A.kode_produk,A.nama_produk,A.nama_supplier
 																	,B.id_satuan,B.kode_satuan,B.status,B.besar_konversi,B.harga
 														);
		SELECT
			COALESCE
            (
				  GROUP_CONCAT(
					DISTINCT
					CONCAT
					(
					  'MAX(IF(kode_satuan = ''',kode_satuan,''', COALESCE(harga,0), 0)) AS ',kode_satuan,'1'
					)
				  )  
			,'NULL')INTO @fieldPivot
		FROM 
		(
			SELECT kode_satuan FROM TMP_SATUKAN GROUP BY kode_satuan
		) AS A
		ORDER BY kode_satuan ASC;
		
		
	
			SET @sql = CONCAT('
				SELECT A.id_produk,A.kode_produk,A.nama_produk,A.nama_supplier,', @fieldPivot, '
				FROM TMP_SATUKAN AS A
				GROUP BY A.id_produk,A.kode_produk,A.nama_produk,A.nama_supplier
		');
		PREPARE stmt FROM @sql;
		EXECUTE stmt;
		DEALLOCATE PREPARE stmt;
	
	DROP TABLE TMP_tb_produk;
    DROP TABLE TMP_tb_produk2;
    DROP TABLE TMP_tb_produk3;
    DROP TABLE TMP_tb_harga_satuan;
    DROP TABLE TMP_SATUKAN;
END */$$
